import React from 'react';
import { useCookies } from 'react-cookie';
import {useNavigate} from "react-router-dom";
import {Button} from "react-bootstrap";
import {toast} from "react-toastify";


const LogoutButton = () => {

    const navigate = useNavigate();

    const [,, removeCookie] = useCookies(['role', 'token']);

    const notify = () => toast.success('Successful logout', {
        position: "top-center",
        autoClose: 2000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
        theme: "light",
    });

    const handleClearCookies = () => {
        //removeCookie('role');
        //removeCookie('token');
        document.cookie = 'role=; Max-Age=-1; path=/;';
        document.cookie = 'token=; Max-Age=-1; path=/;';
        notify();
        navigate("/")
    };

    return (
        <>
            <Button style={{color: "white"}} variant={"primary"} onClick={handleClearCookies}>LogOut</Button>
        </>
    );
};

export default LogoutButton;
